import React, { Component } from "react";
import { pushNotification } from "../../services";
import { Router, Switch, Redirect, Route } from "react-router-dom";
import { connect } from "react-redux";
import { withCookies } from "react-cookie";
import { history } from "../../helpers";
import { alertActions, validatorActions } from "../../actions";
import { PrivateRoute, PublicRoute } from "../../routes";
import { routeConstants } from "../../constants";
import { LoginPage } from "../LoginPage";
import { RegisterPage } from "../RegisterPage";
import { VerificationPage } from "../VerificationPage";
import { LogoutPage } from "../LogoutPage";
import { HomePage } from "../HomePage";
import { ProfilePage } from "../ProfilePage";
import { UserSettingsData } from "../ProfilePage/UserSettingsData";
import { SellingOrders } from "../ProfilePage/Selling";
import { BuyingOrders } from "../ProfilePage/Buying";
import { inviteFriends } from "../ProfilePage/inviteFriends";
import { QuestionComponent } from "../../components/Question/index";
import { UserPage } from "../UserPage";
import { UserTransactionsList } from "../Transactions/userTransactionsList";
import { CreatePostPage } from "../CreatePostPage";
import { PostsPage } from "../PostsPage";
import { PostPage, EditPostPage } from "../PostPage";
import { SearchPage } from "../SearchPage";
import { ShoppingCart } from "../ShoppingCart";
import { CheckoutPage } from "../Checkout";
import {
  OrdersPage,
  OrderDetailsPage,
  SubmitBuyerPickupInfoPage,
  EditOrderItemsPage,
} from "../OrdersPage";
import { PostReview, UpdateReview } from "../Review";
import { Reviews } from "../ProfilePage/Reviews";
import { watchList } from "../watchList";
import { biddingHistory } from "../biddingHistory";
import { ArrivedAtSPPage } from "../ServicePoint";
import { moneyWithdrawal, editWithdrawal } from "../moneyWithdrawalContainer";
import { ReturnRequest } from "../ReturnRequest";
import { createWithdrawal } from "../moneyWithdrawalContainer";
import { ForgetPasswordPage } from "../resetPassword";
import { ResetPasswordPage } from "../resetPassword";
import {
  ViewMyReturnRequests,
  ReturnedItemDropOffPage,
  ReturnedItemPickUpPage,
} from "../ReturnRequest";
import { FavoriteCategoryPage } from "../FavoriteCategory";
import { FAQ } from "../FAQ";
import { ContactUs } from "../ContactUs";
import { FeedBack } from "../ProfilePage/Feedback";
import { ReportProblemPage, TicketsPage, TicketPage } from "../ReportProblem";
import {
  BuyNowForm,
  AuctionWithMinPrice,
  AuctionWithoutMinPrice,
} from "../Seller Decision";
import TermsandConditionsPage from "../Legal/TermsandConditionsPage";
import PrivacyPolicyPage from "../Legal/PrivacyPolicyPage";
import ProductsPolicy from "../Legal/Products Policy";
import FeesPolicy from "../Legal/FeesPolicy";
import TermsAndConditions from "../Legal/TermsAndConditions";
import { LandingPage } from "../LandingPage/LandingPage";
import  InvitationRequest  from "../InvitationRequest/InvitationRequest";

import "../../fonts/IBMPlexSansArabic-Medium.woff";

export class AppContainer extends Component {
  constructor(props) {
    super(props);
    history.listen((location, action) => {
      this.props.clearAlerts();
      this.props.clearValidation();
    });
  }

  async componentDidMount() {
    const { publicVapidKey: base64String } =
      await pushNotification.getPublicVapidKey();
    if (!base64String || base64String === "undefined") return;
  }

  render() {
    return (
      <div id="page-wrapper" className="gray-bg">
        <Router history={history}>
          <Switch>
          <PublicRoute
              exact
              path={routeConstants.INVITATIONREQUEST}
              component={InvitationRequest}
            />
            <Route
              exact
              path={routeConstants.VIEW_CONTACT_US}
              component={ContactUs}
            />
            <PrivateRoute
              exact
              path={routeConstants.FEEDBACK}
              component={FeedBack}
            />
            <PrivateRoute
              exact
              path={routeConstants.EDIT_MONEY_WITHDRAWAL}
              component={editWithdrawal}
            />

            <PrivateRoute
              exact
              path={routeConstants.FORGET_PASSWORD}
              component={ForgetPasswordPage}
            />
            <PrivateRoute
              exact
              path={routeConstants.RESET_PASSWORD}
              component={ResetPasswordPage}
            />
            <PrivateRoute
              exact
              path={routeConstants.CREATE_MONEY_WITHDRAWAL}
              component={createWithdrawal}
            />
            <PrivateRoute
              exact
